import React, { useContext } from "react";
import { NavLink } from "react-router-dom";
import userService from "./../services/userService";
import { AuthContext } from "../context/authContext";

const Navbar = (props) => {
  const { isAuthenticated, user, setIsAuthenticated, setUser } = useContext(
    AuthContext
  );

  React.useEffect(()=>{
    console.log(props?.router?.route?.location?.pathname,props.to)
    console.log(props)
  },[])

  const onClickLogoutHandler = () => {
    userService.logout().then((data) => {
      if (data.success) {
        setUser('');
        setIsAuthenticated(false);
        console.log("LOGOUT_SUCCESSFULL");
        // props.history.push('/')
      }
    });
  };
  const authenticatedNavbar = () => {
    return (
      <>
        <li className="nav-item">  <NavLink className="nav-link" to="/home">Home </NavLink></li>
        <li className="nav-item">  <NavLink className="nav-link" onClick={onClickLogoutHandler}>Logout </NavLink></li>
   </>
    );
  };
  const unauthenticatedNavbar = () => {
    return (
      <>
              <li className="nav-item">  <NavLink className="nav-link" to="/">Login </NavLink></li>
        <li className="nav-item">  <NavLink className="nav-link" to="/Attendance-sheet">Attendance Sheet </NavLink></li>

      </>
    );
  };
  return (
    <div>
      <nav className="navbar navbar-expand-lg navbar-light bg-light">
        <button
          className="navbar-toggler"
          type="button"
          data-toggle="collapse"
          data-target="#navbarTogglerDemo01"
          aria-controls="navbarTogglerDemo01"
          aria-expanded="false"
          aria-label="Toggle navigation"
        >
          <span className="navbar-toggler-icon" />
        </button>
        <div className="collapse navbar-collapse" id="navbarTogglerDemo01">
          <NavLink className="navbar-brand" to="/">
            Aangan Pk
          </NavLink>
          <ul className="navbar-nav ml-auto mt-2 mt-lg-0">
            {!isAuthenticated ? unauthenticatedNavbar() : authenticatedNavbar()}


          </ul>


        </div>
      </nav>
    </div>
  );
};

export default Navbar;
